    try {
        const response = await fetch("http://localhost:5000/flights")
        const jsonData = await response.json();
        console.log("script.js")
        console.table(jsonData)
        setDemos(jsonData);
        displayDemos();
    } catch (err) {
        console.log(err.message);
    }
}

